import styled from "styled-components";

export const Button = styled.button`
  margin-left: 4.8%;
  margin-top: 7%;
  width: 90%;
  height: 48px;
  background-color: #ff577f;
  border: none;
  border-radius: 7px;
  color: white;
  font-size: 16px;
  cursor: pointer;

  &:hover {
    filter: brightness(0.9);
  }
`;
